 autos := Automorphisms(K);
 xnewforms := [* *];
 for f in newforms do;
  if K eq RationalField() then;
   Append(~xnewforms, [* f, autos[1] *]);
  else;
   flag, iso := IsIsomorphic(K,BaseField(f));
   for a in autos do;
